import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import LeaveSessionButton from "./LeaveSession";
import UserCards from "./UserCards";
import BankCards from "./BankCards";
import DrawCards from "./DrawCards"; // Предполагаем, что такой компонент существует

const GamePage = () => {
    const { title } = useParams();
    const [sessionDetails, setSessionDetails] = useState(null);

    useEffect(() => {
        const fetchSessionDetails = async () => {
            try {
                const response = await fetch(`/sessions/details/${title}`);
                if (!response.ok) {
                    throw new Error(`HTTP error! status: ${response.status}`);
                }
                const data = await response.json();
                setSessionDetails(data);
            } catch (error) {
                console.error("Error fetching session details:", error);
            }
        };

        fetchSessionDetails();
    }, [title]);

    if (!sessionDetails) {
        return <div>Загрузка деталей сессии...</div>;
    }


    return (
        <Container>
            <Typography variant="h4" gutterBottom>Игровая сессия: {sessionDetails.title}</Typography>
            <Typography variant="h6">Текущие участники:</Typography>
            <List>
                {sessionDetails.users.map((user, index) => (
                    <ListItem key={index}>
                        <ListItemText primary={user.name} />
                    </ListItem>
                ))}
            </List>

            <Box sx={{ display: 'flex', flexDirection: 'row', justifyContent: 'space-between', mt: 4 }}>
                <Paper elevation={3} sx={{ p: 2, minWidth: 300 }}>
                    <Typography variant="h6">Карты в руке:</Typography>
                    <UserCards />
                </Paper>

                <Paper elevation={3} sx={{ p: 2, minWidth: 300 }}>
                    <Typography variant="h6">Банк:</Typography>
                    {sessionDetails.bank.map((bankEntry, index) => (
                        <Card key={index} sx={{ mb: 2 }}>
                            <CardContent>
                                <Typography variant="subtitle1">Банк игрока: {bankEntry.playerId.name}</Typography>
                                {bankEntry.cards.map((card, cardIndex) => (
                                    <Typography key={cardIndex}>{card.name} ({card.type})</Typography>
                                ))}
                            </CardContent>
                        </Card>
                    ))}
                </Paper>

                <Paper elevation={3} sx={{ p: 2, minWidth: 300 }}>
                    <Typography variant="h6">Собственность:</Typography>
                    {sessionDetails.property.map((propertyEntry, index) => (
                        <Card key={index} sx={{ mb: 2 }}>
                            <CardContent>
                                <Typography variant="subtitle1">Собственность игрока: {propertyEntry.playerId.name}</Typography>
                                {propertyEntry.cards.map((card, cardIndex) => (
                                    <Typography key={cardIndex}>{card.name} ({card.type})</Typography>
                                ))}
                            </CardContent>
                        </Card>
                    ))}
                </Paper>
            </Box>

            <Box sx={{ mt: 4 }}>
                <DrawCards />
            </Box>

            <Box sx={{ mt: 4 }}>
                <LeaveSessionButton sessionTitle={sessionDetails.title} />
            </Box>
        </Container>
    );
};

export default GamePage;
